      link: 'https://ubuntu.com/blog/travel-clis-and-sticky-notes-lilyanas-life-as-a-canonical-ux-designer/',
      title: {
        rendered:
          'Travel, CLIs, and sticky notes: Lilyana\u2019s life as a Canonical UX designer',
      },
      content: {
        rendered:
          '\n<p>Canonical is the company behind Ubuntu, but who are the people behind Canonical? This blog series is all about getting to know the different employees that make up our company.</p>\n\n\n\n<div class="wp-block-image"><figure class="aligncenter is-resized"><img src="https://admin.insights.ubuntu.com/wp-content/uploads/06dd/2D28A7B6-346F-4864-B47C-B41B36496078-1.jpg" alt="" class="wp-image-97549" width="384" height="512"/></figure></div>\n\n\n\n<p>Lilyana Videnova is a Senior User Experience (UX) Designer who has worked on a wide range of Canonical products. We spoke with Lilyana to find out what it\u2019s like designing user experiences for one of the largest, most active open source communities in the world.<br></p>\n\n\n\n<p><strong>What\u2019s your background in IT?</strong></p>\n\n\n\n<p>I\u2019m originally from Bulgaria. I always loved maths and playing games when I was growing up. When it came to applying for university, computer science sounded like the perfect mix of those two. I moved to England nine years ago to study computer science at the University of York, and then went on to do my masters in human-computer interaction at UCL. After graduating, I worked at an education technology startup for two years before joining Canonical.<br></p>\n\n\n\n<p><strong>After working in the same startup for two years, what was it about Canonical that made you want to work here?</strong></p>\n\n\n\n<p>Canonical is at the forefront of open source, which is a field I\u2019ve always been interested in, and I feel that it\u2019s a company that is trying to do something good for the world. A while ago, I spoke with a user who looks after a fairly large server lab at a London University. He told me that if MAAS \u2013 our Metal-as-a-Service solution \u2013 wasn\u2019t open source and completely free to use, they wouldn\u2019t be able to maintain that lab and continue their research. Canonical really is an enabler on a global scale, which I like.<br></p>\n\n\n\n<p><strong>You mentioned MAAS, could you tell us what are you working on at the moment?</strong></p>\n\n\n\n<p>I\u2019m currently creating design guidelines for all of the command-line interfaces (CLIs) used in Canonical products. It&#8217;s an interesting project because it\u2019s not something that a designer would usually be involved in. Typically, CLIs are created and used by engineers, and that often shows in the way they are designed. The new guidelines should help our engineers make command lines that are easier to use and standardised.&nbsp;</p>\n\n\n\n<p>I\u2019m also working on Snapcraft \u2013 the Linux app store \u2013 to encourage more people to download and use snaps; and I\u2019ve previously been part of the MAAS team.&nbsp;<br></p>\n\n\n\n<p><strong>It looks like you work on many different projects. Does your design approach change depending on the project?</strong></p>\n\n\n\n<p>Absolutely, it all depends on the intended audience. Take MAAS and Juju, for instance. Compared to Snapcraft, they are much more technical tools aimed at a more technical audience, so it\u2019s important to strike the right balance between complexity and intelligibility. Since these tools encompass such a wide array of concepts and functions, it\u2019s common for a user to be skilled in one aspect and a novice in another. We need to give users the opportunity to easily expand their knowledge, but without too much \u2018in your face\u2019 advice that might frustrate experts.</p>\n\n\n\n<p>That being said, we do also aim to build similarities across products. Even though Snapcraft and Juju are aimed at different audiences, someone who is familiar with one tool should know what to expect from buttons and layouts in the other. The CLI standardisation project is a good example of how we try to keep the user experience consistent.</p>\n\n\n\n<p><strong>Speaking about your design approach; how do stakeholders factor into design decisions?</strong></p>\n\n\n\n<p>For Snapcraft, we work with three separate engineering teams and a front-end team, as well as end-users. Managing expectations and priorities from all these different groups is always a challenge.</p>\n\n\n\n<p>Feedback from users is especially important \u2013 it drives all the improvements we make. We have analytics looking at how people use the website, and we try to speak directly to users through our forums, surveys, and research panels. It helps that many Canonical engineers are also users of Canonical products, so they\u2019re able to provide valuable feedback on a highly technical level.<br></p>\n\n\n\n<p><strong>How has the shift to remote working impacted your work?</strong></p>\n\n\n\n<p>I\u2019m a bit old school. Before the pandemic, I designed primarily using pen and paper, but now everything is digital. We use tablets and a tool called Miro, which is great for quick sketches and collaboration since everyone can draw on the same canvas. For high fidelity designs, we use Sketch. And of course, we all use lots of sticky notes \u2013 every self-respecting UX designer has to love sticky notes!</p>\n\n\n\n<p>Within the Snapcraft team, we\u2019ve also started having weekly work together sessions. Five of us get together on a two-hour call and tackle any quick tasks we\u2019d normally handle by pulling up a chair to each other\u2019s desks. There\u2019s no set agenda, and it tends to be very productive.<br></p>\n\n\n\n<p><strong>Finally, what kind of opportunities have you had while you\u2019ve been at Canonical?</strong></p>\n\n\n\n<p>The most exciting thing has been all the travel over the last two years. We have sprints in amazing locations. I\u2019ve been to Montreal, Vancouver, Paris, and Cape Town. At those events, I\u2019ve had the chance to go up on stage to present my work, which has definitely helped me to improve my confidence and leadership skills. I\u2019m no longer intimidated presenting my ideas in front of a room of very technical engineers, so we\u2019re able to have productive and interesting discussions.&nbsp;</p>\n\n\n\n<p>In terms of career progression, I was promoted quite quickly to Senior Designer. It\u2019s been really great to be given a lot of responsibility whenever I ask for it, and I\u2019ve been well supported by both peers and higher-ups. It\u2019s a cool environment where I feel like I can be brave in what I want to try.&nbsp;<br></p>\n\n\n\n<p>Canonical is always looking for bright new talent, and we hire from everywhere! Apply <a href="https://canonical.com/careers">here</a> to join the team or go check out our Twitter account <a href="https://twitter.com/ubuntuwantsyou?lang=en">@UbuntuWantsYou</a>.<br></p>\n',
        protected: false,
      },
