      slug: 'kubernetes-1-19-available-from-canonical%ef%bb%bf',
      status: 'publish',
      type: 'post',
      link: 'https://ubuntu.com/blog/2020/08/25/kubernetes-1-19-available-from-canonical%ef%bb%bf/',
      title: { rendered: 'Kubernetes 1.19 available from Canonical\ufeff' },
      content: {
        rendered:
          '\n<p>Canonical today announced full enterprise support for Kubernetes 1.19 spanning from public cloud to the edge, covering <a href="https://ubuntu.com/kubernetes/features">Charmed Kubernetes</a>, <a href="https://microk8s.io/">MicroK8s</a> and <a href="https://blog.ubuntu.com/2018/12/06/canonical-widens-kubernetes-support-with-kubeadm">kubeadm</a>.&nbsp;<br></p>\n\n\n\n<p>\u201cAs with all releases, Canonical is committed to fast following so that users benefit from the latest features, lifecycle operations and enterprise support in line with the upstream. With Kubernetes 1.19, MicroK8s and Charmed Kubernetes also bring enhanced security and carrier grade features. Certification management, IPv6 and SR-IOV are all added across any infrastructure, whether used in development or production,\u201d commented Alex Chalkias, Product Manager at Canonical.<br></p>\n\n\n\n<p>MicroK8s, the lightweight, zero-ops, opinionated Kubernetes is ideal for users that look for K8s on-rails. With support for Intel and Arm chips, MicroK8s is suited for edge environments and IoT use cases. MicroK8s 1.19 comes with new versions for add-ons such as Istio 1.5.1, Prometheus 2.20 and K8s dashboard 2.0. The Multus add-on is now generally available to handle multiple networking Kubernetes plugins simultaneously and the Ambassador add-on provides an API gateway to handle traffic between heterogeneous services. Users of the latest stable MicroK8s track will be automatically upgraded to 1.19.<br></p>\n\n\n\n<p>Charmed Kubernetes is best suited for enterprises looking to streamline their multi-cloud and hybrid cloud production environments by providing elastic K8s with declarative, lifecycle operations.&nbsp; Enterprises running critical production workloads such as telco and retail will benefit from new additions to Charmed Kubernetes 1.19. The latest version is now able to handle more fast networking scenarios with SR-IOV, IPv6 support and security is enhanced with the addition of CIS (Centre for Internet Security) benchmark compliance.&nbsp;</p>\n\n\n\n<h1>What\u2019s new?</h1>\n\n\n\n<p>All upstream Kubernetes 1.19 features are available in MicroK8s and Charmed Kubernetes. Additionally, users benefit from the following new features in Canonical\u2019s distributions:&nbsp;</p>\n\n\n\n<h2>MicroK8s</h2>\n\n\n\n<ul><li>New add-ons generally available:<ul><li>Multus</li><li>Ambassador</li><li>\u201chost-access\u201d for reaching host\u2019s services</li></ul></li><li>Ingress support for UDP and TCP as well as configurable SSL certificates</li><li>Allow for user-provided CA</li><li>MetalLB support for ranges and CIDR notation</li><li>Registry improvements<ul><li>Discovery support</li><li>Configurable size</li></ul></li><li>Add-on version updates:<ul><li>Istio v1.5.1</li><li>Dashboard v2.0.0</li><li>Linkerd v2.8.0</li><li>MetalLB v0.9.3</li><li>Fluentd v3.0.2</li><li>Prometheus v2.20.0</li></ul></li></ul>\n\n\n\n<h2>Charmed Kubernetes</h2>\n\n\n\n<ul><li>IPv6</li><li>SR-IOV</li><li>CIS benchmark compliance</li><li>Ubuntu 20.04 LTS support</li></ul>\n',
        protected: false,
      },
